import styled from "styled-components"

const buttonEdit = styled.button`
background-color: green;
width:10px
`
const buttonDelete = styled.button`
background-color: red;
`
const buttonAdd = styled.button`
background-color: blue;
width:10px;
background: black;
  color: white;
  border-radius: 7px;
  padding: 20px;
  margin: 10px;
  font-size: 16px;
`

export {
    buttonEdit,
    buttonDelete,
    buttonAdd
}
